window.bookSummaryJSON = "<p>The battle in the heavens has left a target on Lindon’s back.</p> <p>His most reliable ally is gone, the Monarchs see him as a threat, and he has inherited one of the most valuable facilities in the world. At any moment, his enemies could band together to kill him.</p> <p>If it weren’t for the Dreadgods.</p> <p>All four are empowered and unleashed, rampaging through Cradle, and grudges old and new must be set aside. The Monarchs need every capable fighter to help them defend their territory.</p> <p>And Lindon needs time.</p> <p>While he fights, he sends his friends off to train. They’ll need to advance impossibly fast if they want to join him in battle against the kings and queens of Cradle.</p> <p>Together, they will need power enough to rival a Dreadgod.</p>"; 
